import axios from "axios";
import React, { useEffect } from "react";
import { useState } from "react";
import { Table,Button } from "react-bootstrap";
import Header from "./Header";
import { Link } from "react-router-dom";

const Usercrud = () => {
  const [user, getuser] = useState([]);

  

  useEffect(function () {
    axios.get("http://localhost:8000/api/user").then(
      function (rsp) {
        //console.log(rsp)
        getuser(rsp.data);
      },
      function (err) {}
    );
  }, []);

  
    return (
      <body className="">
        <Header />
        <br />
        <section class="col-lg-10 offset-lg-1 ">
          <Table striped bordered hover size="lg">
            <thead>
              <tr className=" table-danger">
                <th>Id</th>
                <th>Firstname</th>
                <th>Lastname</th>
                <th>Email</th>
                <th>Password</th>
                <th>Phone</th>
                <th>Usertype</th>
                <th>Address</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody className="table-primary">
              {user.map((dc) => (
                <tr>
                  <td>{dc.id}</td>
                  <td>{dc.firstname}</td>
                  <td>{dc.lastname}</td>
                  <td>{dc.email}</td>
                  <td>{dc.password}</td>
                  <td>{dc.phone}</td>
                  <td>{dc.usertype}</td>
                  <td>{dc.address}</td>
                  <td>
                    <button type="button" class="btn btn-primary btn-sm m-1">
                      Edit
                    </button>

                    <div className="">
                      {delet.map((apt) => (
                        <div className="col-12 col-md-4  text-white  ">
                          <div class="backgrounddsfcsd py-4 my-2 rounded">
                            <p>Doctor Name : {apt.dname}</p>
                            <p>Date: {apt.date}</p>
                            <p>Day: {apt.day}</p>
                            <p>Time: {apt.slot}</p>
                            <button
                              id="apt-deletbtn"
                              onClick={() => handledelete(apt.id)}
                            >
                              Cancel
                            </button>
                          </div>
                        </div>
                      ))}
                    </div>
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
          <Link to="/admin">
            <Button variant="primary">Go back</Button>
          </Link>
        </section>
      </body>
    );
};

export default Usercrud;
